# Structure for table "vcb_favorites"
#

DROP TABLE IF EXISTS `vcb_favorites`;
CREATE TABLE `vcb_favorites` (
  `favorites_id` int(32) NOT NULL AUTO_INCREMENT,
  `created` datetime DEFAULT NULL,
  `user_id` int(32) DEFAULT NULL,
  `sku_id` int(11) DEFAULT NULL,
  `product_id` varchar(50) DEFAULT NULL,
  `shop_site` int(16) DEFAULT NULL,
  `shop_id` varchar(50) DEFAULT NULL,
  `shop_username` varchar(100) DEFAULT NULL,
  `shop_url` varchar(500) DEFAULT NULL,
  `product_url` varchar(500) DEFAULT NULL,
  `img_path` varchar(500) DEFAULT NULL,
  `product` varchar(255) DEFAULT NULL,
  `status` int(16) DEFAULT NULL,
  PRIMARY KEY (`favorites_id`)
) ENGINE=InnoDB AUTO_INCREMENT=147 DEFAULT CHARSET=utf8;

